import React, { useState } from "react";
import { useForm, FormProvider, useFormContext } from "react-hook-form";
import { Input } from "../../components/input";
import { CadastrarContainer, FormContainer, FormContent } from './styles';

const Step1 = ({ nextStep }: { nextStep: () => void }) => {
  const { control } = useFormContext(); // Acessa o contexto compartilhado

  return (
    <div>
      <h2>Digite suas informações</h2>
      <label>Nome:</label>
      <Input
        name="nome-completo"
        control={control}
        type="text"
        placeholder="Nome Sobrenome"
        isRequired={true}
      />
      <label>Data de Nascimento:</label>
      <Input
        name="data-nascimento"
        control={control}
        type="date"
        isRequired={true}
      />
      <label>CPF:</label>
      <Input
        name="cpf"
        control={control}
        type="text"
        placeholder="999.999.999-99"
        isRequired={true}
      />
      <label>Telefone:</label>
      <Input
        name="telefone"
        control={control}
        type="text"
        placeholder="(99) 99999-9999"
        isRequired={true}
      />
      <button type="button" onClick={nextStep}>Próximo</button>
    </div>
  );
};

const Step2 = ({ prevStep, nextStep }: { prevStep: () => void; nextStep: () => void }) => {
  const { control } = useFormContext(); // Acessa o mesmo contexto

  return (
    <div>
      <h2>Email e senha para login</h2>
      <label>Digite seu email*</label>
      <Input
        name="endereco"
        control={control}
        type="text"
        placeholder="Rua, Número, Bairro"
        isRequired={true}
      />
      <label>Digite sua senha*</label>
      <Input
        name="cidade"
        control={control}
        type="text"
        placeholder="Digite sua cidade"
        isRequired={true}
      />
      <label>Confirme sua senha*</label>
      <Input
        name="estado"
        control={control}
        type="text"
        placeholder="Digite seu estado"
        isRequired={true}
      />
      <button type="button" onClick={prevStep}>Voltar</button>
      <button type="button" onClick={nextStep}>Próximo</button>
    </div>
  );
};


const Step3 = ({ prevStep, nextStep }: { prevStep: () => void; nextStep: () => void }) => {
  const { control } = useFormContext(); // Pega o controle do FormProvider

  return (
    <div>
      <h2>Sobre seu apartamento</h2>
      <label>Qual o seu bloco?</label>
      <Input
        name="email"
        control={control}
        type="email"
        placeholder="email@exemplo.com"
        isRequired={true}
      />
      <label>Qual é o n° do apartamento?</label>
      <Input
        name="email"
        control={control}
        type="email"
        placeholder="email@exemplo.com"
        isRequired={true}
      />
      <button type="button" onClick={prevStep}>Voltar</button>
      <button type="button" onClick={nextStep}>Próximo</button>
    </div>
  );
};


const Step4 = ({ prevStep }: { prevStep: () => void }) => {
  const { control } = useFormContext(); // Pega o controle do FormProvider

  return (
    <div>
      <h2>Sobre seu veículo</h2>
      <label>Digite o modelo</label>
      <Input
        name="email"
        control={control}
        type="email"
        placeholder="email@exemplo.com"
        isRequired={true}
      />
      <label>Digite a placa</label>
      <Input
        name="email"
        control={control}
        type="email"
        placeholder="email@exemplo.com"
        isRequired={true}
      />
      <button type="button" onClick={prevStep}>Voltar</button>
      <button type="submit">Enviar</button>
    </div>
  );
};



const Cadastrar = () => {
  const methods = useForm(); // Inicializa o react-hook-form
  const { handleSubmit } = methods; // Para capturar o evento de submit

  const [step, setStep] = useState(1);

  const nextStep = () => setStep((prev) => prev + 1);
  const prevStep = () => setStep((prev) => prev - 1);

  const onSubmit = (data: any) => {
    console.log("Formulário submetido:", data);
    // Aqui você pode enviar os dados para o backend
  };

  return (
    <CadastrarContainer>
    <header>
      <h1 className="logo">CondoFacil</h1>
      <a href="/login">Já possui uma conta?</a>
    </header>

    <FormContainer>
      <FormContent>
        <FormProvider {...methods}>
          <form onSubmit={handleSubmit(onSubmit)}>
            <div>
              <h1>CondoFácil</h1>
              {step === 1 && <Step1 nextStep={nextStep} />}
              {step === 2 && <Step2 nextStep={nextStep} prevStep={prevStep} />}
              {step === 3 && <Step3 nextStep={nextStep} prevStep={prevStep} />}
              {step === 4 && <Step4 prevStep={prevStep} />}

              <div>
                <p>Passo {step} de 4</p>
              </div>
            </div>
          </form>
        </FormProvider>
      </FormContent>
    </FormContainer>

    </CadastrarContainer>

  );
};

export { Cadastrar };
